import {useRouter} from "next/router";
import Header from "../../components/Header";
import React from "react";
import axios from 'axios'

export async function getServerSideProps(context){
    //handle if person or business url
    //assume business url
    let data = context.query.page;
    return{props:{data}}
}

const Page = ({data}) => {
    const router = useRouter();

    console.log(data);

    let pageUrl = "http://www.facebook.com/" + router.query.page;

    axios.get(pageUrl).then((res)=>{
        let sidebar = res;
        console.log(sidebar)
    })

    return (
        <div>
            <Header />
            <div>
                <h1>{router.query.page}</h1>
            </div>
        </div>
    );
};

export default Page;
